  `id` int NOT NULL AUTO_INCREMENT,
  `slug` varchar(100) NOT NULL,
  `user_slug` varchar(100) NOT NULL,
  `chat_room_slug` varchar(100) NOT NULL,
  `message_slug` varchar(100) NOT NULL,
  `is_sender` tinyint(1) DEFAULT '0',
  `is_read` tinyint(1) DEFAULT '0',
  `read_timestamp` datetime DEFAULT NULL,
  `deletedAt` datetime DEFAULT NULL,
  `createdAt` datetime NOT NULL,
  `updatedAt` datetime NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `slug` (`slug`),
  KEY `user_slug` (`user_slug`),
  KEY `chat_room_slug` (`chat_room_slug`),
  KEY `message_slug` (`message_slug`),
  CONSTRAINT `chat_message_statuses_ibfk_1` FOREIGN KEY (`user_slug`) REFERENCES `users` (`slug`) ON DELETE CASCADE,
  CONSTRAINT `chat_message_statuses_ibfk_2` FOREIGN KEY (`chat_room_slug`) REFERENCES `chat_rooms` (`slug`) ON DELETE CASCADE,
  CONSTRAINT `chat_message_statuses_ibfk_3` FOREIGN KEY (`message_slug`) REFERENCES `chat_messages` (`slug`) ON DELETE CASCADE
