/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_type` varchar(50) NOT NULL,
  `name` varchar(50) DEFAULT NULL,
  `username` varchar(50) DEFAULT NULL,
  `firstname` varchar(50) DEFAULT NULL,
  `lastname` varchar(50) DEFAULT NULL,
  `facebook_url` varchar(50) DEFAULT NULL,
  `email` varchar(50) DEFAULT NULL,
  `mobile_no` varchar(15) DEFAULT NULL,
  `password` varchar(255) NOT NULL,
  `location` geometry DEFAULT NULL,
  `city` varchar(255) DEFAULT NULL,
  `country` varchar(255) DEFAULT NULL,
  `slug` varchar(100) DEFAULT NULL,
  `latitude` varchar(255) DEFAULT NULL,
  `longitude` varchar(255) DEFAULT NULL,
  `bio` varchar(255) DEFAULT NULL,
  `image_url` varchar(255) DEFAULT NULL,
  `background_url` varchar(255) DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  `is_email_verify` tinyint(1) DEFAULT '0',
  `is_profile_completed` tinyint(1) DEFAULT '0',
  `is_guideline` tinyint(1) DEFAULT '0',
  `form_status` int DEFAULT '0',
  `email_verifyAt` datetime DEFAULT NULL,
  `is_mobile_verify` tinyint(1) DEFAULT '0',
  `mobile_verifyAt` datetime DEFAULT NULL,
  `login_type` varchar(30) DEFAULT 'custom',
  `platform_type` varchar(100) DEFAULT NULL,
  `platform_id` text,
  `is_activated` tinyint(1) DEFAULT '1',
  `is_blocked` tinyint(1) DEFAULT '0',
  `is_pushNotification` tinyint(1) DEFAULT '1',
  `is_privacy` tinyint(1) DEFAULT '1',
  `deletedAt` datetime DEFAULT NULL,
  `createdAt` datetime NOT NULL,
  `updatedAt` datetime NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `slug` (`slug`),
  KEY `user_type` (`user_type`),
  CONSTRAINT `users_ibfk_1` FOREIGN KEY (`user_type`) REFERENCES `user_groups` (`type`)
) ENGINE=InnoDB AUTO_INCREMENT=44 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

